(12, 9, 22, 'HOT-A116 Laptop, Mini 11.6-Inch Quad-Core Ultra-Thin Laptop', '964940992', '[\"White\",\"Gray\",\"Black\"]', 'It\'s small in size and easy to carry. It\'s 11.6-inch mini size. It\'s smaller in length and width than A4 paper size. It can be stored in briefcase. It\'s lighter and more comfortable for business travel\r\nEnvironmental protection plastic body, through complex processes to create a delicate art like exquisite technology, create a light and delicate Press, people today love\r\nIt\'s a challenge to travel without burden. You can take off the computer bag, put down the adapter and mobile power supply. You don\'t need to turn on the hot spot of mobile phone. You don\'t need to ask WIFI to carry the notebook. It\'s light, thin, fast and simple, which can meet the full demand of mobile office\r\nIn order to achieve high efficiency, the notebook meets the more stringent requirements of networking, endurance, speed and efficiency. Compared with the traditional office book, it almost ignores the limitations of time, place and carrying, and achieves more efficient office\r\nThe long-distance challenge from sunrise to sunset has a comprehensive endurance of more than 5 hours, which is 20% more than that of ordinary netbooks. It is used for long-term standby mobile office\r\nProduct parameter\r\nModel: A116\r\nDisplay: 11.6 inch LED\r\nResolution 1366*768\r\nProcessor: Celeron processor J4105 1.80Ghz, 4 cores 4 threads\r\nMemory: Built-in 8G\r\nimage: Core image\r\nHard disk: support for installing M.2 hard disk\r\nOperating system: Windows10, you can install Windows8\r\nWireless network: RTL8723 BS LAN802.11n with Bluetooth\r\nWired network: no wired network card, external USB network card\r\nCamera: 300,000 HD camera\r\nBattery: 3000MAh high capacity lithium battery\r\nPower adapter: input 100-240V, output 12V, output 2.5A\r\nPlug Type: US Plug,it applies to Canada, India, Japan, Mexico, Thailand, Taiwan, the United States, the Philippines and so on.\r\nPlug Type :EU Plug,it applies to Indonesia, Germany, France, Spain, Italy and so on.\r\nColour:White/Pink/Black\r\nMaterial:ABS\r\nSize:29.2x19.7x1.7cm\r\n\r\nPackage Contents:\r\n1* laptop\r\nOnly the above package content, other products are not included.\r\nNote: Light shooting and different displays may cause the color of the item in the picture a little different from the real thing. The measurement allowed error is +/- 1-3cm.', 189.00, '1615209129.2332029534600.jpg', '2021-03-08 07:12:09', '2021-03-08 07:12:09'),
